import React from 'react';
import {CardTitle, Card, CardSubtitle, CardBody, CardImg} from 'reactstrap';

const CurrentWeatherCard = ({ cityName, stateName, currentTime, icon, temp, wind }) => {
  return (
  <div>
    <Card>
        <CardTitle>{cityName}, {stateName}</CardTitle>
        {/* put in clock? */}
        <CardSubtitle>{currentTime}</CardSubtitle>
        <CardImg src={icon}/>
        <CardBody>Current Temperature:{temp} Wind: {wind}</CardBody>
    </Card>
  </div>
  )
};

export default CurrentWeatherCard;
